import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';

const Navigation = () => {
  return (
    <div>
    <Navbar className="bg-primary">
          <Navbar.Brand href="#home">
            <img
              src="/img/logo.svg"
              width="30"
              height="30"
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            />{' '}
            React Bootstrap
          </Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Navigation;
